import meter1 from "../assets/img/meter1.svg";
import meter2 from "../assets/img/meter2.svg";
import meter3 from "../assets/img/meter3.svg";
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import arrow1 from "../assets/img/arrow1.svg";
import arrow2 from "../assets/img/arrow2.svg";
import colorSharp from "../assets/img/color-sharp.png"

export const Skills = () => {
  const responsive = {
    superLargeDesktop: {
      // the naming can be any, depends on you.
      breakpoint: { max: 4000, min: 3000 },
      items: 5
    },
    desktop: {
      breakpoint: { max: 3000, min: 1024 },
      items: 3
    },
    tablet: {
      breakpoint: { max: 1024, min: 464 },
      items: 2
    },
    mobile: {
      breakpoint: { max: 464, min: 0 },
      items: 1
    }
  };

  return (
    <section className="skill" id="skills">
        <div className="container">
            <div className="row">
                <div className="col-12">
                    <div className="skill-bx wow zoomIn">
                    <h2>Skills</h2>
          <p>
            As a Full Stack Developer, I possess expertise across the entire web development lifecycle, from crafting intuitive user interfaces to implementing robust backend solutions.<br></br> Below are some of my key areas of proficiency.
          </p>
          <Carousel responsive={responsive} infinite={true} className="owl-carousel owl-theme skill-slider">
            <div className="item">
              <img src={meter2} alt="Frontend Development" />
              <h5>Frontend Development</h5>
            </div>
            <div className="item">
              <img src={meter2} alt="Backend Development" />
              <h5>Backend Development</h5>
            </div>
            <div className="item">
              <img src={meter3} alt="Database Management" />
              <h5>Database Management</h5>
            </div>
            <div className="item">
              <img src={meter1} alt="API Integration" />
              <h5>API Integration</h5>
            </div>
            <div className="item">
              <img src={meter2} alt="Version Control" />
              <h5>Version Control (Git/GitHub)</h5>
            </div>
            <div className="item">
              <img src={meter3} alt="Cloud Deployment" />
              <h5>Cloud Deployment</h5>
            </div>
          </Carousel>
                    </div>
                </div>
            </div>
        </div>
        <img className="background-image-left" src={colorSharp} alt="Image" />
    </section>
  )
}
